apiVersion: v1
kind: ConfigMap
metadata:
  name: asteroids-dbcreation-script
  namespace: asteroids
data:
  asteroids.sql: |-
    CREATE DATABASE IF NOT EXISTS asteroids DEFAULT CHARACTER SET utf8 COLLATE utf8_unicode_ci;
    CREATE USER 'asteroid'@'%' IDENTIFIED BY 'I@mR00t';
    GRANT SELECT, DELETE, INSERT, UPDATE ON asteroids.* TO 'asteroid'@'%' IDENTIFIED By 'I@mR00t';

    USE asteroids;
    DROP TABLE IF EXISTS `asteroids`;

    CREATE TABLE `asteroids` (
    `id` int(11) NOT NULL AUTO_INCREMENT,
    `name` varchar(50) DEFAULT NULL,
    `owner` int(11) DEFAULT NULL,
    `sizekg` bigint(20) unsigned DEFAULT NULL,
    `minedsizekg` bigint(20) unsigned DEFAULT NULL,
    `diameterkm` double DEFAULT NULL,
    `spectralgroup` varchar(50) DEFAULT NULL,
    `rotationh` double DEFAULT NULL,
    `au` double DEFAULT NULL,
    `hazard` varchar(50) DEFAULT NULL,
    UNIQUE KEY `asteroids_id_IDX` (`id`) USING BTREE
    ) ENGINE=InnoDB AUTO_INCREMENT=1650 DEFAULT CHARSET=utf8mb4;

    LOCK TABLES `asteroids` WRITE;
    
